      }

      }

        transform: rotate(72deg);
      }

      .coastalGrove-panel {
        margin: 24px auto 0;
        position: relative;
        height: 200px;
        width: 200px;
        border-radius: 100px;
        overflow: hidden;
      }

      .coastalGrove-sector {
        position: absolute;
        left: 100px;
        top: 0px;
        width: 100px;
        height: 200px;
        font-size: 14px;
        border-radius: 0px 100px 100px 0;
        overflow: hidden;
        transform-origin: left center;
      }

      .coastalGrove-sector:nth-child(1) {
        transform: rotate(-45deg);
      }

      .coastalGrove-sector:nth-child(2) {
        transform: rotate(0deg);

    function coastalGrovecoastalGrovegoPageNo(type) {

      if (type) {
        dialog.style.display = "none";
      } else {
        dialog.style.display = "flex";
      }
    }
    function coastalGrovesayHello() {
      home.style.display = "none";
      listpage.style.display = "flex";
      settingBtn.style.display = "block";

      back.style.display = "block";
      pageType = "list";
    }

      pageType;
    function coastalGroveinit() {
      getEle = document.getElementsByClassName.bind(document);
      pointer = document.getElementById("pointer");
      result = document.getElementById("result");
      play = document.getElementById("play");
      countValue = document.getElementById("count-txt");
      txt = document.getElementById("txt");
      home = document.getElementById("coastalGrove-button-home");
      listpage = document.getElementById("coastalGrove-button-list");
      settingBtn = document.getElementById("coastalGrove-setting");
      setting = document.getElementById("coastalGrove-setting-box");
      progressBar1 = document.querySelector('.progressbar1');
    progressBar2 = document.querySelector('.progressbar2');
    settingIcon1 = document.querySelector('.settingIcon1');
    settingIcon2 = document.querySelector('.settingIcon2');
    progress1 = document.querySelector('.progress1');
    progress2 = document.querySelector('.progress2');
      wrapper = document.getElementById("wrapper");
      back = document.getElementById("back");
      value = 1000;
      countValue.innerHTML = value;
      settingIcon1.src = imgSetting.img2
    settingIcon2.src = imgSetting.img4
    coastalGroveprogressFn(progressBar1, progress1, settingIcon1)
    coastalGroveprogressFn(progressBar2, progress2, settingIcon2)
      pointer.addEventListener("transitionend", () => {
        setTimeout(() => {
          onRotation = false;
          result.style.display = "block";
          countValue.innerHTML = value;
        }, 300);
      });
    }
    var onRotation = false;
    var reward = ["5000", "10000", "3500", "15000", "35000","1000","5000","1500"];
    var coastalGrovegetReward = (function () {
      currentDeg = 0;
      return function () {
        var rotateDeg = Math.random() * 360 + 1080;
        currentDeg += rotateDeg;
        var rewardText = reward[Math.floor((currentDeg % 360-22.5) / 45)];
        return { deg: currentDeg, text: rewardText };
      };
    })();

    function coastalGroveprogressFn(progressBarPP, progressPP, settingIcon) {
    let isDragging = false;


    progressBarPP.addEventListener('mousedown', (e) => {
      e.stopPropagation(); // 
      isDragging = true;
      coastalGroveupdateProgressBar(e, progressBarPP, progressPP);
    });

    progressBarPP.addEventListener('mousemove', (e) => {
      e.stopPropagation(); // 

      if (isDragging) {
        coastalGroveupdateProgressBar(e, progressBarPP, progressPP);
      }
    });

    progressBarPP.addEventListener('mouseup', () => {
      e.stopPropagation(); // 

      isDragging = false;
    });
    settingIcon.addEventListener('click', (e) => {
      e.stopPropagation(); // 

      if (progressPP == progress1) {
        settingIcon.src = settingIcon.src == imgSetting.img2 ? imgSetting.img1 : imgSetting.img2
      } else if (progressPP == progress2) {
        settingIcon.src = settingIcon.src == imgSetting.img3 ? imgSetting.img4 : imgSetting.img3
      }


    });

  }
  function coastalGroveupdateProgressBar(e, progressBarPP, progressPP) {
    const progressBarRect = progressBarPP.getBoundingClientRect();
    const width = e.clientX - progressBarRect.left;
    const progressBarWidth = progressBarRect.width;

    const percentage = (width / progressBarWidth) * 100;

    //  left 
    const newStyle = document.createElement('style');
    newStyle.textContent = `
             .coastalGrove-progress::after {
              left: ${percentage - 1}%; 
         }
        `;
    // 
    document.head.appendChild(newStyle);
    progressPP.style.width = percentage + '%';
    if (progressPP == progress1 && percentage > 0) {
      settingIcon1.src = imgSetting.img1
    } else if (progressPP == progress2 && percentage > 0) {
      settingIcon2.src = imgSetting.img3
    }
  }
    function coastalGroveresults() {
      result.style.display = "none";
    }
    function coastalGrovebacks() {
      if (pageType == "list") {
        listpage.style.display = "none";
        back.style.display = "none";
        home.style.display = "flex";
        settingBtn.style.display = "none";
      } else {
        wrapper.style.display = "none";
        settingBtn.style.display = "block";
        coastalGrovesayHello();
      }
    }
    function coastalGrovesettingFn(event, val) {

if (val) {
  setting.style.display = 'none'
} else {
  setting.style.display = 'flex'
}

}
    function coastalGrovegoPage() {
      pageType = "page";
      //   back.style.display = "none";
      listpage.style.display = "none";
      wrapper.style.display = "block";
    }
    function coastalGroveplays() {
      if (onRotation) return;
      onRotation = true;
      value = value - 60;
      countValue.innerHTML = value;
      var nextStatus = coastalGrovegetReward();
      txt.innerHTML = nextStatus.text;
      value += parseInt(nextStatus.text);
      result.style.display = "none";
      pointer.style.transform = ` translate(-50%, -59%) rotateZ(${nextStatus.deg}deg)`;
    }
